init:
 lload A, B, payload
 lload C, D, 0x09800000+ProgramAddr ; VRAM
 lload F, G, 0 ;counter
 .payload_loop:
  rmem E, A, B
  wmem E, C, D
  cmpeqi F, 0xFFFF, 1
   addi G, 1, G
  addi F, 1, F
  cmpeqi B, 0xFFFF, 1
   addi A, 1, A
  addi B, 1, B
  cmpeqi D, 0xFFFF, 1
   addi C, 1, C
  addi D, 1, D
  cmpeqi F, 0x0DE5, 3
   cmpeqi G, 0x0004, 2
    core 2, 1, ProgramAddr ;start GPU
    jmp .while_true
  jmp .payload_loop
 .while_true:
  wait 1000000
  ;put your code here!
  halt 0
  jmp .while_true